import React from "react";
import "./nav.css";
const NavBar = () => {
  return (
    <div className="navbox">
      <h2>NETFLIX</h2>
      <div className="sign_in_button">SIGN IN</div>
      <button className="navbox_end">Join Now</button>
    </div>
  );
};

export default NavBar;
